import { useState } from "react";
import Header from "../components/Header";

export default function Home() {
  const [tableNumber, setTableNumber] = useState("");

  return (
    <div className="bg-cream min-h-screen pt-20">
      <Header tableNumber={tableNumber} setTableNumber={setTableNumber} />

      <div className="p-4">
        <h2 className="text-choco text-center text-xl font-semibold mb-2">
          Minuman
        </h2>
        <div className="grid grid-cols-2 gap-4">{/* Menu minuman */}</div>

        <h2 className="text-choco text-center text-xl font-semibold mt-8 mb-2">
          Makanan
        </h2>
        <div className="grid grid-cols-2 gap-4">{/* Menu makanan */}</div>
      </div>
    </div>
  );
}
